import React from 'react';

import store from '../store/index';

export default class ListsMovies extends React.Component {
    render() {
        return(
            <div className="lists-movies-wrapper">
                {store.getState().selectedMovieList.map((item, idx) => (
                    <div key={idx}>
                        {item.title}
                    </div>
                ))}
            </div>
        )
    }
}
